import  React, {useEffect, useState} from 'react';
import { 
    HomeContainer, 
    TitleName,TitleContainer, 
    Bio, 
    InfoContainer, 
    GithubContainer,
    TitleCard,
    BodyCard
} from './styles';

import api from '../../services/api';
import GitHubIcon from '@material-ui/icons/GitHub';


const Home = ()=> {
    const [user, setUsers] = useState({});
    let github: any = user;

    const Search = async () => {
        await api.get('/users')
        .then((res) => {
            setUsers(res.data)
        }).catch((err) => {
            alert(err.response.data)
        })
    }

    useEffect(()=>{Search()}, []);
    console.log(user);

    return(
        <HomeContainer>
            <TitleContainer>
              <TitleName>KLIHSMAN</TitleName>
              <Bio>Olá, me chamo Klihsman Freitas, sou um desenvolvedor full-stack, com foco em desenvolvimento front-end na stack JS (Node, React e React-native). Tenho experiência em desenvolvimento de sites e aplicativos em geral. Além disso, sou formando em Análise e Desenvolvimento de sistemas pelo Instituto Federal da Paraíba (IFPB).</Bio>              
            </TitleContainer>
            <InfoContainer>
                <GithubContainer>
                    <TitleCard>
                        <h2>Github</h2>
                        <GitHubIcon />
                    </TitleCard>
                    <BodyCard>
                        <img src={`${github.avatar_url}`} alt='Profile'/>
                        <h1>{github.name}</h1>
                        <p>{github.bio}</p>
                        <span>{github.location}</span>
                        <a href={`${github.html_url}`}>{github.html_url}</a>
                    </BodyCard>
                </GithubContainer>
            </InfoContainer>
        </HomeContainer>
    )
}

export default Home;
